import SearchMembers from "../components/SearchMembers";
import { useState, useEffect } from "react";
import { NavLink } from "react-router-dom";
import axios from "axios";

export default function Members() {
  const [profiles, setProfiles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchProfiles();
  }, []);

  const fetchProfiles = async () => {
    try {
      const response = await axios.get('http://127.0.0.1:8000/users/profile/');
      setProfiles(response.data);
      setLoading(false);
    } catch (error) {
      setError('Error fetching profiles');
      setLoading(false);
    }
  }

  return (
    <div>
      <div className="mt-32">
        <SearchMembers />
      </div>
      <div className="grid grid-cols-2 place-content-center md:max-w-max md:mx-auto md:grid-cols-3 lg:grid-cols-4 mt-12 mb-20 animate-fade-down">
        {loading ? (
          <p>Loading profiles...</p>
        ) : error ? (
          <p>{error}</p>
        ) : (
          profiles.map(profile => (
            <NavLink to={`/Profile/${profile.id}`} key={profile.id}>
              <div className="vignette flex flex-col justify-center items-center text-center bg-white z-0 md:h-96 w-72 mx-auto mr-3 mt-3 pb-2 rounded-3xl shadow-xl hover:opacity-85">
                <p className="text-center text-lg font-semibold mt-3">{profile.name}</p>
                <img
                  src={profile.picture}
                  className="z-20 h-40 md:h-3/4 w-56 my-3 object-cover mx-auto shadow-sm rounded-3xl"
                  alt={`Profile picture of ${profile.name}`}
                />
                {profile.race && (
                  <p className="flex flex-row text-center text-lg font-semibold mb-1">
                    {profile.race} {profile.sex}
                  </p>
                )}
              </div>
            </NavLink>
          ))
        )}
      </div>
    </div>
  );
}
